import {useNavigate} from "react-router-dom";


export function BasketItem({item}){
    const navigate = useNavigate()

    return <div className={'border-b-2 ml-2 mr-2'}>
        <div className={'cursor-pointer text-black/80 font-semibold mb-2'}
             onClick={()=>navigate(`/${item.categoryAPI}/${item.nameAPI}`)}>{item.name}
        </div>
        <div className={'mb-2 mr-2 flex'}>
            <img src={item.image} alt={'nkar'} className={'w-[75px] h-[75px] rounded-md'}/>
            <div className={' w-full'}>
                <div className={'flex justify-between  text-black font-semibol  m-2'}>
                    <span>{item.title}</span>
                    <span>{item.price}</span>
                </div>
                <div></div>
            </div>
        </div>

    </div>
}
